import './App.css';
import React, { useState, useRef, useEffect } from 'react';
import { PayPalButton } from "react-paypal-button";

function App() {
  const paypalOptions = {
    clientId: "Ae8PMczRMIptgKH8TxjTTr6G9J1nfv-askxxIqA3CRpqyr9hQ4SuJB_PEwQXxvN-ld69sGrg6AyNU31M",
    intent: 'capture',
    currency: 'MXN'
  }

  const buttonStyles = {
    layout: 'vertical',
    shape: 'rect'
  }

  return (
    <div className="App">
      <h1>Prueba Paypal</h1>
      <PayPalButton 
        paypalOptions={paypalOptions}
        buttonStyles={buttonStyles}
        amount={0.01}
        />
    </div>
  );
}

export default App;
